import React, { useEffect, useState } from "react";
import { Routes, Route, Link } from 'react-router-dom';
import logo from '../img/oina.png';
import Singup from "./Singup";
import axios from 'axios'

function Singin() {
    const [Email, setEmail] = useState('')
    const [Password, setPassword] = useState('')
    return (
        <div className="Singup">
            <img src={logo} alt="" />
            <form action="">
                <div className="form-text">
                    <h4>Электронная почта</h4>
                    <input type="text" name="login" id="login" placeholder="Введите электронную почту" onChange={(e) => setEmail(e.target.value)}/>
                </div>
                <div className="form-text">
                    <h4>Пароль</h4>
                    <input type="password" name="password" id="password" placeholder="Введите пароль" onChange={(e) => setPassword(e.target.value)}/>
                </div>
                <br /><button type="submit" className="button" >Войти</button>
                <br />Впервые у нас? <Link to="/Singup">Зарегистрируйтесь!</Link>
            </form>
        </div>
    )
}

export default Singin;
